import{_ as e,o as r,c as a,O as t}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 46.2-1500 Definitions.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/46.2-1500.md","filePath":"vacode/46.2-1500.md"}'),o={name:"vacode/46.2-1500.md"},i=t('<h1 id="§-46-2-1500-definitions" tabindex="-1">§ 46.2-1500 Definitions. <a class="header-anchor" href="#§-46-2-1500-definitions" aria-label="Permalink to &quot;§ 46.2-1500 Definitions.&quot;">​</a></h1><p>As used in this chapter, unless the context requires a different meaning:</p><p>&quot;Affiliate&quot; means any entity in which a manufacturer, factory branch, distributor, or distributor branch has voting control or owns at least 51 percent of the ownership equity, or any entity in which another entity has voting control or owns at least 51 percent of the ownership equity and also has voting control and owns at least 51 percent of the ownership of a manufacturer, factory branch, distributor, or distributor branch. An entity that provides vehicle purchase or lease financing that uses the name of the manufacturer or distributor, or the name of any line make of the manufacturer or distributor, in the name of the entity under which it transacts business with a consumer, other than in the name of an individual product offered by the entity, shall be considered an &quot;affiliate.&quot;</p><p>&quot;Board&quot; means the Motor Vehicle Dealer Board.</p><p>&quot;Camping trailer&quot; means a recreational vehicle constructed with collapsible partial side walls that fold for towing by a consumer-owned tow vehicle and unfold at the campsite to provide temporary living quarters for recreational, camping, or travel use.</p><p>&quot;Certificate of origin&quot; means the document provided by the manufacturer of a new motor vehicle or new trailer, or its distributor, which is the only valid indication of ownership between the manufacturer, its distributor, its franchised motor vehicle dealers, and the original purchaser not for resale.</p><p>&quot;Dealer-operator&quot; means the individual who works at the established place of business of a dealer and who is responsible for and in charge of day-to-day operations of that place of business.</p><p>&quot;Demonstrator&quot; means a new motor vehicle having a gross vehicle weight rating of less than 16,000 pounds that (i) has more than 750 miles accumulated on its odometer that has been driven by dealer personnel or by prospective purchasers during the course of selling, displaying, demonstrating, showing, or exhibiting it and (ii) may be sold as a new motor vehicle, provided the dealer complies with the provisions of subsection D of § <a href="/vacode/46.2-1530/">46.2-1530</a>.</p><p>&quot;Distributor&quot; means a person who is licensed by the Department under this chapter and who sells or distributes new motor vehicles or new trailers pursuant to a written agreement with the manufacturer to franchised motor vehicle dealers in the Commonwealth.</p><p>&quot;Distributor branch&quot; means a branch office licensed by the Department under this chapter and maintained by a distributor for the sale of motor vehicles to motor vehicle dealers or for directing or supervising, in whole or in part, its representatives in the Commonwealth.</p><p>&quot;Distributor representative&quot; means a person who is licensed by the Department under this chapter and employed by a distributor or by a distributor branch, for the purpose of making or promoting the sale of motor vehicles or for supervising or contacting its dealers, prospective dealers, or representatives in the Commonwealth.</p><p>&quot;Factory branch&quot; means a branch office maintained by a person for the sale of motor vehicles to distributors or for the sale of motor vehicles to motor vehicle dealers, or for directing or supervising, in whole or in part, its representatives in the Commonwealth.</p><p>&quot;Factory representative&quot; means a person who is licensed by the Department under this chapter and employed by a person who manufactures or assembles motor vehicles or by a factory branch for the purpose of making or promoting the sale of its motor vehicles or for supervising or contacting its dealers, prospective dealers, or representatives in the Commonwealth.</p><p>&quot;Factory repurchase motor vehicle&quot; means a motor vehicle sold, leased, rented, consigned, or otherwise transferred to a person under an agreement that the motor vehicle will be resold or otherwise retransferred only to the manufacturer or distributor of the motor vehicle, and which is reacquired by the manufacturer or distributor, or its agents.</p><p>&quot;Family member&quot; means a person who either (i) is the spouse, child, grandchild, spouse of a child, spouse of a grandchild, brother, sister, or parent of the dealer or owner or (ii) has been employed continuously by the dealer for at least five years.</p><p>&quot;Franchise&quot; means a written contract or agreement between two or more persons whereby one person, the franchisee, is granted the right to engage in the business of offering and selling, offering and delivering pursuant to a lease, servicing, or offering, selling, and servicing new motor vehicles or new trailers of a particular line-make or late model or used motor vehicles of a particular line-make manufactured or distributed by the grantor of the right, the franchisor, and where the operation of the franchisee&#39;s business is substantially associated with the franchisor&#39;s trademark, trade name, advertising, or other commercial symbol designating the franchisor, the motor vehicle or its manufacturer or distributor. &quot;Franchise&quot; includes any severable part or parts of a franchise agreement which separately provides for selling and servicing different line-makes of the franchisor.</p><p>&quot;Franchised late model or franchised used motor vehicle dealer&quot; means a dealer selling used motor vehicles, including vehicles purchased from the franchisor, under the trademark of a manufacturer or distributor that has a franchise agreement with a manufacturer or distributor.</p><p>&quot;Franchised motor vehicle dealer&quot; or &quot;franchised dealer&quot; means a dealer in new motor vehicles or new trailers that has a franchise agreement with a manufacturer or distributor of new motor vehicles or new trailers to sell new motor vehicles or new trailers or to sell used motor vehicles under the trademark of a manufacturer or distributor regardless of the age of the motor vehicles.</p><p>&quot;Fund&quot; means the Motor Vehicle Dealer Board Fund.</p><p>&quot;Independent motor vehicle dealer&quot; means a dealer in used motor vehicles.</p><p>&quot;Late model motor vehicle&quot; means a motor vehicle of the current model year and the immediately preceding model year.</p><p>&quot;Line-make&quot; means the name of the motor vehicle manufacturer or distributor and a brand or name plate marketed by the manufacturer or distributor. The line-make of a motorcycle manufacturer, factory branch, distributor, or distributor branch includes every brand of all-terrain vehicle, autocycle, and off-road motorcycle manufactured or distributed bearing the name of the motorcycle manufacturer or distributer.</p><p>&quot;Manufactured home dealer&quot; means any person licensed as a manufactured home dealer under Chapter 4.2 (§ <a href="/vacode/36-85.16/">36-85.16</a> et seq.) of Title 36.</p><p>&quot;Manufacturer&quot; means a person who is licensed by the Department under this chapter and engaged in the business of constructing or assembling new motor vehicles or new trailers and, in the case of trucks, recreational vehicles, and motor homes, also means a person engaged in the business of manufacturing engines, transmissions, power trains, or rear axles, when such engines, transmissions, power trains, or rear axles are not warranted by the final manufacturer or assembler of the truck, recreational vehicle, or motor home.</p><p>&quot;Motorcycle&quot; means every motor vehicle designed to travel on not more than three wheels in contact with the ground, except any vehicle within the term &quot;farm tractor&quot; or &quot;moped&quot; as defined in § <a href="/vacode/46.2-100/">46.2-100</a>. Except as otherwise provided, for the purposes of this chapter, all-terrain vehicles, autocycles, and off-road motorcycles are deemed to be motorcycles.</p><p>&quot;Motor home&quot; means a motorized recreational vehicle designed to provide temporary living quarters for recreational, camping, or travel use that contains at least four of the following permanently installed independent life support systems that meet the National Fire Protection Association standards for recreational vehicles: (i) a cooking facility with an onboard fuel source; (ii) a potable water supply system that includes at least a sink, a faucet, and a water tank with an exterior service supply connection; (iii) a toilet with exterior evacuation; (iv) a gas or electric refrigerator; (v) a heating or air conditioning system with an onboard power or fuel source separate from the vehicle engine; or (vi) a 110-125 volt electric power supply.</p><p>&quot;Motor vehicle&quot; means the same as provided in § <a href="/vacode/46.2-100/">46.2-100</a>, except, for the purposes of this chapter, &quot;motor vehicle&quot; includes trailers, as defined in this section, and does not include (i) manufactured homes, sales of which are regulated under Chapter 4.2 (§ <a href="/vacode/36-85.16/">36-85.16</a> et seq.) of Title 36; (ii) nonrepairable vehicles, as defined in § <a href="/vacode/46.2-1600/">46.2-1600</a>; (iii) salvage vehicles, as defined in § <a href="/vacode/46.2-1600/">46.2-1600</a>; or (iv) mobile cranes that exceed the size or weight limitations as set forth in § <a href="/vacode/46.2-1105/">46.2-1105</a>, <a href="/vacode/46.2-1110/">46.2-1110</a>, or <a href="/vacode/46.2-1113/">46.2-1113</a> or Article 17 (§ <a href="/vacode/46.2-1122/">46.2-1122</a> et seq.) of Chapter 10.</p><p>&quot;Motor vehicle dealer&quot; or &quot;dealer&quot; means any person who:</p><ol><li><p>For commission, money, or other thing of value, buys for resale, sells, or exchanges, either outright or on conditional sale, lease, chattel mortgage, or other similar transaction or arranges or offers or attempts to solicit or negotiate on behalf of others the sale, purchase, or exchange of, either outright or on conditional sale, lease, chattel mortgage, or other similar transaction, an interest in new motor vehicles, new and used motor vehicles, or used motor vehicles alone, whether or not the motor vehicles are owned by him; or</p></li><li><p>Is wholly or partly engaged in the business of selling new motor vehicles, new and used motor vehicles, or used motor vehicles only, whether or not the motor vehicles are owned by him.</p></li></ol><p>Any person who offers to sell, sells, displays, or permits the display for sale, of five or more motor vehicles within any 12 consecutive months is presumed to be a motor vehicle dealer and may rebut the presumption by a preponderance of the evidence.</p><p>For the purposes of Article 7.2 (§ <a href="/vacode/46.2-1573.2/">46.2-1573.2</a> et seq.), &quot;dealer&quot; means recreational vehicle dealer. For the purposes of Article 7.3 (§ <a href="/vacode/46.2-1573.13/">46.2-1573.13</a> et seq.), &quot;dealer&quot; means trailer dealer and watercraft trailer dealer. For the purposes of Article 7.4 (§ <a href="/vacode/46.2-1573.25/">46.2-1573.25</a> et seq.), &quot;dealer&quot; means motorcycle dealer.</p><p>&quot;Motor vehicle dealer&quot; or &quot;dealer&quot; does not include:</p><ol><li><p>Receivers, trustees, administrators, executors, guardians, conservators or other persons appointed by or acting under judgment or order of any court or their employees when engaged in the specific performance of their duties as employees.</p></li><li><p>Public officers, their deputies, assistants, or employees, while performing their official duties.</p></li><li><p>Persons other than business entities primarily engaged in the leasing or renting of motor vehicles to others when selling or offering such vehicles for sale at retail, disposing of motor vehicles acquired for their own use and actually so used, when the vehicles have been so acquired and used in good faith and not for the purpose of avoiding the provisions of this chapter.</p></li><li><p>Persons dealing solely in the sale and distribution of fire-fighting vehicles, ambulances, and funeral vehicles, including motor vehicles adapted therefor; however, this exemption shall not exempt any person from the provisions of §§ <a href="/vacode/46.2-1519/">46.2-1519</a>, <a href="/vacode/46.2-1520/">46.2-1520</a>, and <a href="/vacode/46.2-1548/">46.2-1548</a>.</p></li><li><p>Any financial institution chartered or authorized to do business under the laws of the Commonwealth or the United States which may have received title to a motor vehicle in the normal course of its business by reason of a foreclosure, other taking, repossession, or voluntary reconveyance to that institution occurring as a result of any loan secured by a lien on the vehicle.</p></li><li><p>An employee of an organization arranging for the purchase or lease by the organization of vehicles for use in the organization&#39;s business.</p></li><li><p>Any person licensed to sell real estate who sells a manufactured home or similar vehicle in conjunction with the sale of the parcel of land on which the manufactured home or similar vehicle is located.</p></li><li><p>Any person who permits the operation of a motor vehicle show or permits the display of motor vehicles for sale by any motor vehicle dealer licensed under this chapter.</p></li><li><p>An insurance company authorized to do business in the Commonwealth that sells or disposes of vehicles under a contract with its insured in the regular course of business.</p></li><li><p>Any publication, broadcast, or other communications media when engaged in the business of advertising, but not otherwise arranging for the sale of vehicles owned by others.</p></li><li><p>Any person dealing solely in the sale or lease of vehicles designed exclusively for off-road use.</p></li><li><p>Any credit union authorized to do business in Virginia, provided the credit union does not receive a commission, money, or other thing of value directly from a motor vehicle dealer.</p></li><li><p>Any person licensed as a manufactured home dealer, broker, manufacturer, or salesperson under Chapter 4.2 (§ <a href="/vacode/36-85.16/">36-85.16</a> et seq.) of Title 36.</p></li><li><p>The State Department of Social Services or local departments of social services.</p></li><li><p>Any person dealing solely in the sale and distribution of utility or cargo trailers that have unloaded weights of 3,000 pounds or less; however, this exemption shall not exempt any person who deals in stock trailers or watercraft trailers.</p></li><li><p>Any motor vehicle manufacturer or distributor selling a new motor vehicle at wholesale to its franchised dealer or a used motor vehicle to a licensed dealer.</p></li></ol><p>For the purposes of Article 7 (§ <a href="/vacode/46.2-1566/">46.2-1566</a> et seq.), &quot;dealer&quot; does not include recreational vehicle dealers, trailer dealers, watercraft trailer dealers, or motorcycle dealers.</p><p>&quot;Motor vehicle salesperson&quot; or &quot;salesperson&quot; means (i) any person who is hired as an employee by a motor vehicle dealer to sell or exchange motor vehicles and who receives or expects to receive a commission, fee, or any other consideration from the dealer; (ii) any person who supervises salespersons employed by a motor vehicle dealer, whether compensated by salary or by commission; (iii) any person, compensated by salary or commission by a motor vehicle dealer, who negotiates with or induces a customer to enter into a security agreement on behalf of a dealer; or (iv) any person who is licensed as a motor vehicle dealer and who sells or exchanges motor vehicles. For purposes of this section, any person who is an independent contractor as defined by the United States Internal Revenue Code shall be deemed not to be a motor vehicle salesperson.</p><p>&quot;Motor vehicle show&quot; means a display of motor vehicles to the general public at a location other than a dealer&#39;s location licensed under this chapter where the vehicles are not being offered for sale or exchange during or as part of the display.</p><p>&quot;New motor vehicle&quot; means any vehicle, excluding trailers, that is in the possession of the manufacturer, factory branch, distributor, distributor branch, or motor vehicle dealer and for which an original title has not been issued by the Department or by the issuing agency of any other state and has less than 7,500 miles accumulated on its odometer.</p><p>&quot;New trailer&quot; means any trailer that (i) has not been previously sold except in good faith for the purpose of resale; (ii) has not been used as a rental, driver education, or demonstration trailer or for the personal or business transportation of the manufacturer, distributor, dealer, or any of its employees; (iii) has not been used except for limited use necessary in moving or road testing the trailer prior to delivery to a customer; (iv) is transferred by a certificate of origin; and (v) has the manufacturer&#39;s certification that it conforms to all applicable federal trailer safety and emission standards. Notwithstanding clauses (i) and (iii), a trailer that has been previously sold but not titled shall be deemed a new trailer if it meets the requirements of clauses (ii), (iv), and (v).</p><p>&quot;Original license&quot; means a motor vehicle dealer license issued to an applicant who has never been licensed as a motor vehicle dealer in Virginia or whose Virginia motor vehicle dealer license has been expired for more than 30 days.</p><p>&quot;Recreational vehicle&quot; or &quot;RV&quot; means a vehicle that (i) is either self-propelled or towed by a consumer-owned tow vehicle, (ii) is primarily designed to provide temporary living quarters for recreational, camping, or travel use; and (iii) complies with all applicable federal vehicle regulations and does not require a special movement permit to legally use the highways. Recreational vehicle includes motor homes, travel trailers, and camping trailers.</p><p>&quot;Relevant market area&quot; means as follows:</p><ol><li><p>For motor vehicle dealers except motorcycle dealers, in metropolitan localities the relevant market area shall be a circular area around an existing franchised dealer with a population of 250,000, not to exceed a radius of 10 miles, but in no case less than seven miles.</p></li><li><p>For motor vehicle dealers except motorcycle dealers, if the population in a circular area within a radius of 10 miles around an existing franchised dealer is less than 250,000, but the population in an area within a radius of 15 miles around an existing franchised dealer is 150,000 or more, the relevant market area shall be that circular area within the 15-mile radius.</p></li><li><p>For motor vehicle dealers except motorcycle dealers, in all other cases the relevant market area shall be a circular area within a radius of 20 miles around an existing franchised dealer or the area of responsibility defined in the franchise agreement, whichever is greater. In any case where the franchise agreement is silent as to area of responsibility, the relevant market area shall be the greater of a circular area within a radius of 20 miles around an existing franchised dealer or that area in which the franchisor otherwise requires the franchisee to make significant retail sales or sales efforts.</p></li><li><p>For motorcycle dealers, the relevant market area shall be a circular area within a radius of 20 miles if the population within such area around an existing franchised dealer location is one million or more. If the population in a circular area within a 20-mile radius is less than one million, the relevant market area shall be a circular area within a radius of 30 miles. If the population within a 30-mile radius is less than one million, the relevant market area shall be a circular area within a radius of 40 miles. In all cases, the relevant market area shall be the area described above or the area of responsibility defined in the franchise agreement, whichever is greater. In addition, the relevant market area shall include that area in which the franchisor otherwise requires the franchisee to make significant retail sales or sales efforts.</p></li></ol><p>Notwithstanding the foregoing provision of this section, in the case of dealers in motor vehicles with gross vehicle weight ratings of 26,000 pounds or greater, excluding recreational vehicles, the relevant market area with respect to the dealer&#39;s franchise for all such vehicles shall be a circular area around an existing franchised dealer with a radius of 25 miles, except where the population in such circular area is less than 250,000, in which case the relevant market area shall be a circular area around an existing franchised dealer with a radius of 50 miles, or the area of responsibility defined in the franchise, whichever is greater.</p><p>In determining population for relevant market areas, the most recent census by the U.S. Bureau of the Census or the most recent population update, either from the National Planning Data Corporation or other similar recognized source, shall be accumulated for all census tracts either wholly or partially within the relevant market area.</p><p>&quot;Retail installment sale&quot; means every sale of one or more motor vehicles to a buyer for his use and not for resale, in which the price of the vehicle is payable in one or more installments and in which the seller has either retained title to the goods or has taken or retained a security interest in the goods under form of contract designated either as a security agreement, conditional sale, bailment lease, chattel mortgage, or otherwise.</p><p>&quot;Sale at retail&quot; or &quot;retail sale&quot; means the act or attempted act of selling, bartering, exchanging, or otherwise disposing of a motor vehicle to a buyer for his personal use and not for resale.</p><p>&quot;Sale at wholesale&quot; or &quot;wholesale&quot; means a sale to motor vehicle dealers or wholesalers other than to consumers; a sale to one who intends to resell.</p><p>&quot;Semitrailer&quot; means every vehicle of the trailer type so designed and used in conjunction with another motor vehicle that some part of its own weight and that of its own load rests on or is carried by another vehicle.</p><p>&quot;Tractor truck&quot; means every motor vehicle designed and used primarily for drawing other vehicles and not so constructed as to carry a load other than a part of the load and weight of the vehicle attached thereto.</p><p>&quot;Trailer&quot; means every vehicle without motive power designed for carrying property or passengers wholly on its own structure and for being drawn by another motor vehicle, including semitrailers but not manufactured homes, watercraft trailers, camping trailers, or travel trailers.</p><p>&quot;Travel trailer&quot; means a vehicle designed to provide temporary living quarters for recreational, camping, or travel use of such size or weight so as not to require a special highway movement permit when towed by a consumer-owned tow vehicle.</p><p>&quot;Used motor vehicle&quot; means any vehicle other than a new motor vehicle as defined in this section.</p><p>&quot;Watercraft trailer&quot; means any new or used trailer specifically designed to carry a watercraft or a motorboat and purchased, sold, or offered for sale by a watercraft dealer licensed under Chapter 8 (§ <a href="/vacode/29.1-800/">29.1-800</a> et seq.) of Title 29.1.</p><p>&quot;Watercraft trailer dealer&quot; means any watercraft dealer licensed under Chapter 8 (§ <a href="/vacode/29.1-800/">29.1-800</a> et seq.) of Title 29.1.</p><p>&quot;Wholesale auction&quot; means an auction of motor vehicles restricted to sales at wholesale.</p><p>Code 1950, § 46-503; 1950, p. 1604; 1956, c. 120; 1958, c. 541, § 46.1-516; 1962, c. 368; 1964, c. 375; 1974, c. 189; 1975, c. 304; 1976, c. 362; 1980, c. 161; 1982, c. 394; 1983, c. 234; 1986, c. 630; 1988, c. 865; 1989, cc. 15, 148, 727; 1992, cc. 134, 148, 572; 1993, c. 124; 1994, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0888" target="_blank" rel="noreferrer">888</a>; 1995, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?951+ful+CHAP0767" target="_blank" rel="noreferrer">767</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?951+ful+CHAP0816" target="_blank" rel="noreferrer">816</a>; 1996, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP1053" target="_blank" rel="noreferrer">1053</a>; 1997, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?971+ful+CHAP0801" target="_blank" rel="noreferrer">801</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?971+ful+CHAP0848" target="_blank" rel="noreferrer">848</a>; 1999, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?991+ful+CHAP0077" target="_blank" rel="noreferrer">77</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?991+ful+CHAP0910" target="_blank" rel="noreferrer">910</a>; 2004, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0111" target="_blank" rel="noreferrer">111</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0788" target="_blank" rel="noreferrer">788</a>; 2005, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0456" target="_blank" rel="noreferrer">456</a>; 2006, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?061+ful+CHAP0441" target="_blank" rel="noreferrer">441</a>; 2010, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?101+ful+CHAP0284" target="_blank" rel="noreferrer">284</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?101+ful+CHAP0292" target="_blank" rel="noreferrer">292</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?101+ful+CHAP0318" target="_blank" rel="noreferrer">318</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?101+ful+CHAP0459" target="_blank" rel="noreferrer">459</a>; 2014, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0053" target="_blank" rel="noreferrer">53</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0075" target="_blank" rel="noreferrer">75</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0256" target="_blank" rel="noreferrer">256</a>; 2015, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?151+ful+CHAP0236" target="_blank" rel="noreferrer">236</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?151+ful+CHAP0615" target="_blank" rel="noreferrer">615</a>; 2019, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0160" target="_blank" rel="noreferrer">160</a>; 2020, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0984" target="_blank" rel="noreferrer">984</a>.</p>',56),n=[i];function s(l,h,c,d,u,p){return r(),a("div",null,n)}const g=e(o,[["render",s]]);export{m as __pageData,g as default};
